'Failure'

Alternative Comics, 2013, 1

Written and Illustrated by Karl Stevens

Failure collects Karl Stevens' beautifully rendered humorous comic strips from the Phoenix, Boston's leading alternative weekly. His slice of life vignettes and surreal anthropomorphic experiments are revealing sketches of urban America and beyond.
